  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:08.161407\",\n\t\"name\": \"environmental-assessment-land-exchange-between-the-city-of-virginia-beach-and-the-u-s-fish\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Environmental Assessment (EA) will
  identify and evaluate the environmental and socioeconomic impacts of the United
  States Fish and Wildlife Service's (Service) proposal to exchange approximately
  20 acres within the Back Bay National Wildlife Refuge (Refuge) with the City of
  Virginia Beach (City) for City properties of similar value. The proposed land exchange
  will allow the City to re-align and improve the Sandbridge Road corridor thus reducing
  potentially hazardous road conditions, and improving highway drainage and the quality
  of the storm water discharged into local waterways. The proposed land exchange will
  also benefit Service trust resources by adding additional lands to the Refuge. All
  lands proposed for exchange are located within the current acquisition boundary
  which was established in 1989.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
